  return (
    <div>
      <div className="left">
        Lorem ipsum dolor sit amet consectetur adipisicing elit. Consectetur,
        aliquid eveniet reprehenderit, impedit voluptatem tempora dolores a et
        corrupti architecto dolore? Quasi, voluptatum at dolorum cum laboriosam
        facilis itaque corporis?
      </div>
      <div className="right">
        <div>로그인</div>
        <div>회원 가입</div>
      </div>
    </div>
  );
}

export default Intro;
